import React from 'react';

const RepositoryItem = () => {
  return(
    <div>
      <h2>app-curriculo</h2>
      <h4>full name:</h4>
      <a 
        href="https://github.com/BrunoMundim/app-curriculo"
        target="_blank" 
        rel="noreferrer"                
      > BrunoMundim/app-curriculo </a>

    </div>  
  )
}

export default RepositoryItem;
